INSERT INTO `spec_aid_lang` VALUES (1,'duration - positive','duration - positive','Very good! You didn\'t exceed the limit of 270 days.',NULL,NULL,'en',1),(2,'ZV Dauer - positiv','ZV Dauer - positiv','Sehr gut! Sie haben die vorgegebene Zeit von 270 Tagen nicht überschritten.',NULL,NULL,'de',1),(3,'duration - negative','duration - negative','Attention! You already exceeded the limit of 270 days.',NULL,NULL,'en',2),(4,'ZV Dauer negativ','ZV Dauer negativ','Achtung! Sie haben die vorgegebene Zeit von 270 Tagen bereits überschritten.',NULL,NULL,'de',2),(5,'project cost - positive','costs - positive','Very good! You spent * EUR of the given budget (225000 EUR).',NULL,NULL,'en',3),(6,'ZV Kosten - positiv','ZV Kosten positiv','Sehr gut! Sie haben * EUR des vorgegebenen Budgets (225000 EUR) verbraucht.',NULL,NULL,'de',3),(7,'project cost - negative','costs - negative','Attention! You spent * EUR and exceeded the budget limit of 225000 EUR.',NULL,NULL,'en',4),(8,'ZV Kosten - negativ','ZV Kosten negativ','Achtung, Sie haben die Budgetgrenze überschritten! Sie haben * EUR verbraucht. Verfügbar waren nur 225000 EUR.',NULL,NULL,'de',4),(9,'AFP Code - negative','AFP Code negative','Attention! You implemented only * % of the AFPs in the code. The required limit is 95 %!',NULL,NULL,'en',5),(10,'ZV AFP Code - negativ','ZV AFP Code negativ','Achtung! Sie haben * % der gewünschten AFPs (95 %) für den Code erreicht.',NULL,NULL,'de',5),(11,'AFP code - positive','AFP code positive','Very good! You already implemented * % of the AFPs in the code, so you managed to achieve the requirements of 95 %.',NULL,NULL,'en',6),(12,'ZV AFP Code - positiv','ZV AFP Code positiv','Sehr gut! Sie haben bereits * % der geforderten AFPs (95 %) für den Code erreicht.',NULL,NULL,'de',6),(13,'errors per KLOC - positive','errors per KLOC positive','Very good! The code contains only * errors per KLOC. You managed to achieve the requirements of 12 errors per KLOC.',NULL,NULL,'en',7),(14,'ZV Fehler pro KLOC - positiv','ZV Fehler pro KLOC positiv','Sehr gut! Ihr Code enthält nur * Fehler pro KLOC. Sie haben die gewünschte Grenze von 12 Fehlern pro KLOC eingehalten.',NULL,NULL,'de',7),(15,'errors per KLOC - negative','errors per KLOC negative','Attention! The code contains * errors per KLOC. You didn\'t manage to achieve the requirements of 12 errors per KLOC.',NULL,NULL,'en',8),(16,'ZV Fehler pro KLOC - negativ','ZV Fehler pro KLOC negativ','Achtung! Ihr Code enthält noch * Fehler pro KLOC. Sie haben die gewünschte Grenze von 12 Fehlern pro KLOC nicht eingehalten.',NULL,NULL,'de',8),(17,'errors per KLOC - negative','errors per KLOC negative','Attention! You didn\'t start with the implementation.\nThe code should contain less than 12 errors per KLOC.',NULL,NULL,'en',60),(18,'ZV Fehler pro KLOC - negativ','ZV Fehler pro KLOC negativ','Achtung! Sie haben noch nicht mit der Codierung begonnen. \nSie sollten die gewünschte Grenze von 12 Fehlern pro KLOC erreichen.',NULL,NULL,'de',60),(19,'AFP manual - positive','AFP manual positive','Very good! The manual covers * % of the required AFPs. The required limit was 95 % of the AFPs.',NULL,NULL,'en',9),(20,'ZV AFP HB - positiv','ZV AFP HB positiv','Sehr gut! Sie haben * % der AFPs für das Handbuch erreicht. Damit haben Sie die Anforderung des Kundne (95 %) bereits erreicht.',NULL,NULL,'de',9),(21,'AFP manual - negative','AFP manual negative','Attention! The manual covers * % of the required AFPs. The required limit was 95 %.',NULL,NULL,'en',10),(22,'ZV AFP HB - negativ','ZV AFP HB negativ','Achtung! Sie haben * % der AFPs für das Handbuch erreicht. Die Anforderungen des Kunden liegen bei 95 %!',NULL,NULL,'de',10),(23,'errors per page - positive','errors per page positive','Very good! The manual contains only * errors per page. You   the required limit of 0.5 errors per page in the manual.',NULL,NULL,'en',11),(24,'ZV Fehler pro Seite - positiv','ZV Fehler pro Seite positiv','Sehr gut! Ihr Handbuch enthält nur * Fehler pro Seite. Sie haben die gewünschte Grenze von 0,5 Fehlern pro Seite im Handbuch eingehalten.',NULL,NULL,'de',11),(25,'errors per page - negative','errors per page negative','Attention! The manual contains * errors per page. You have reached the required limit of 0.5 errors per page in the manual.',NULL,NULL,'en',12),(26,'ZV Fehler pro Seite - negativ','ZV Fehler pro Seite negativ','Achtung! Ihr Handbuch enthält * Fehler pro Seite. Sie haben die gewünschte Grenze von 0,5 Fehlern pro Seite im Handbuch nicht eingehalten.',NULL,NULL,'de',12),(27,'errors per page - negative','errors per page negative','Attention! You did not begin writing the documentation.\nPlease remember! You have to reach the required limit of 0.5 errors per page.',NULL,NULL,'en',61),(28,'ZV Fehler pro Seite - negativ','ZV Fehler pro Seite negativ','Achtung! Sie haben noch nicht mit dem Handbuch begonnen. \nVergessen Sie nicht! Sie sollten die gewünschte Grenze von 0,5 Fehlern pro Seite erreichen.',NULL,NULL,'de',61),(29,'Completeness of documents','Completeness of documents','Description: \nThe diagram shows the Completeness of the project documents. (Values: *)\n\nExplanation/Recommendations:\nQuality slightly decreases from document to document. However, the better the quality (in terms of number of AFPs realized) of the specification, the easier it is to maintain the quality of the succeeding documents. By putting additional effort on the testing phase, the quality of the code can be increased, too.','Documents','AFPs','en',13),(30,'Vollständigkeit der Dokumente','Vollständigkeit der Dokumente','Beschreibung: \nDas Diagramm zeigt die Vollständigkeit der Dokumente des Projekts. (Werte: *)\n\nErklärung/Empfehlungen:\nQualität verringert sich von Dokument zu Dokument leicht. Aber je besser die Qualität der Spezifikation ist (ausgedrückt durch die umgesetzte Anzahl AFPs), desto leichter ist es, die Qualität der nachfolgenden Dokumente aufrecht zu erhalten. Durch zusätzlichen Aufwand in der Testphase kann auch die Qualität des Codes erhöht werden.','Dokumente','AFPs','de',13),(31,'Errors in documents','Errors in documents','Description: \nThis diagram shows the remaining errors in the documents. (Values: *)\n\nExplanation/Recommendations:\nIf the specification contains more than 30 errors, then you did not review this document thoroughly. In later phases the correction of documents is more costly and timeexpensive, as the number of errors increases during the project. Already at early stages of the project you should try to produce documents that are correct and complete.','Documents','Errors','en',14),(32,'Restfehler der Dokumente','Restfehler der Dokumente','Beschreibung:\nDieses Diagramm zeigt die Restfehler in dem jeweiligen Dokument. (Werte: *)\n\nErklärung/Empfehlungen:\nEnthält bereits die Spezifikation zu viele Fehler (mehr als 30), dann wurde dieses Dokument nicht gründlich genug geprüft. Da sich die Fehler in den nachfolgenden Phasen fortpflanzen, und eine Korrektur zu einem späteren Zeitpunkt immer aufwändiger und kostenintensiver wird, sollte versucht werden die Dokumente der ersten Phasen möglichst gründlich und fehlerfrei zu erstellen.','Dokumente','Fehler','de',14),(33,'Errors in the specification','Errors in the specification','Description: \nThis diagram shows the errors remaining in the specification. (Values: *)\n\nExplanation/Recommendations\nWhen the specification contains more than 30 analysis errors, then you did not review the document thoroughly. Maybe you have forgotten to invite the customer to the review of the specification. The customer should always participate in a review of the specification, because he/she detects a lot of errors which would otherwise not have been found. At an early project stage the customer also helps to find missing functionality that can be easily integrated into the system. If the specification document was reviewed more than once and still contains a lot of errors, then you should take a closer look at the review teams. Maybe you have chosen the wrong developers. Please note the specification document contains only analysis errors (AE).','Kind of error','Errors','en',15),(34,'Restfehler in der Spezifikation','Restfehler in der Spezifikation','Beschreibung:\nDieses Diagramm zeigt die Restfehler in der Spezifikation. (Werte: *)\n\nErklärung/Empfehlungen:\nEnthält die Spezifikation noch viele Analysefehler (mehr als 30), dann wurde das Dokument nicht ausreichend geprüft. Möglicherweise wurde der Kunde nicht zu einem Review der Spezifikation eingeladen. Der Kunde sollte allerdings immer an mindestens einem Review teilnehmen, da er viele Fehler findet, die die Gutachter nicht entdecken können. Außerdem kann er auf fehlende Funktionalitäten hinweisen, die zu einem frühen Zeitpunkt noch recht günstig integriert werden können. Wurde die Spezifikation mehrmals geprüft und enthält trotzdem viele Fehler, dann sollte die Zusammenstellung der Reviewteams genauer untersucht werden. Möglicherweise waren die ausgewählten Mitarbeiter als Gutachter nicht qualifiziert. Anmerkung: Die Spezifikation enthält nur Analysefehler (AE).','Fehlerart','Fehler','de',15),(35,'Errors in the system design','Errors in the system design','Description:\nThe diagram shows the errors remaining in the system design. (Values: *)\n\nExplanation/Recommendations:\nWhen the system design contains a lot of errors, then you did not review the document thoroughly. Don\'t forget that the errors increase during the project. When the system design document was reviewed more than once and contains still a lot of errors, then you should take a closer look at the different review teams. Maybe you have chosen the wrong developers.','Kind of error','Errors','en',16),(36,'Restfehler im Systemdesign','Restfehler im Systemdesign','Beschreibung:\nDas Diagramm zeigt die Restfehler im Systemdesign. Die Fehler werden nach der Fehlerart (Analysefehler (AF), Grobentwurfsfehler (GF)) aufgeschlüsselt. (Werte: *)\n\nErklärung/Empfehlungen:\nEnthält das Systemdesigndokument viele Fehler, dann wurde das Dokument nicht ausreichend geprüft. Es muss immer beachtet werden, dass die Fehler aus dem Vorgabedokument übernommen werden. Wurde das Dokument mehrmals geprüft und enthält trotzdem viele Fehler, dann sollte die Zusammenstellung der Reviewteams genauer untersucht werden. Möglicherweise waren die ausgewählten Mitarbeiter als Gutachter nicht qualifiziert.','Fehlerart','Fehler','de',16),(37,'Errors in the module design','Errors in the module design','Description: \nThe diagram shows the remaining errors of the module design. The errors are grouped by the kind of error. (Values: *)\n\nExplanation/Recommendations:\nWhen the module design contains a lot of errors, then you did not review the document properly. Don\'t forget that the errors increase during the project. If the module design document was reviewed more than once and contains still a lot of errors, then you should take a closer look at the different review teams. Maybe you have chosen the wrong developers.','Kind of error','Errors','en',17),(38,'Restfehler im Moduldesign','Restfehler im Moduldesign','Beschreibung:\nDas Diagramm zeigt die Restfehler im Moduldesign. Die Fehler werden nach der Fehlerart (Analysefehler (AF), Grobentwurfsfehler (GF), Feinentwurfsfehler (FF)) aufgeschlüsselt. (Werte: *)\n\nErklärung/Empfehlungen:\nEnthält das Moduldesigndokument viele Fehler, dann wurde das Dokument nicht ausreichend geprüft. Es muss immer beachtet werden, dass die Fehler aus dem Vorgabedokument übernommen werden. Wurde das Dokument mehrmals geprüft und enthält trotzdem viele Fehler, dann sollte die Zusammenstellung der Reviewteams genauer untersucht werden. Möglicherweise waren die ausgewählten Mitarbeiter als Gutachter nicht qualifiziert.','Fehlerart','Fehler','de',17),(39,'Errors in the code','Errors in the code','Description: \nThe diagram shows the remaining errors in the code. The errors are grouped by the kind of error. (Values: *)\n\nExplanation/Recommendations:\nIf the code contains a lot of errors, then you did not review the document thoroughly. Don\'t forget that the errors increase during the project. If the code was reviewed more than once and contains still a lot of errors, then you should take a closer look at the different review teams. Maybe you have chosen the wrong developers.','Kind of error','Errors','en',18),(40,'Restfehler im Code','Restfehler im Code','Beschreibung: \nDas Diagramm zeigt die Restfehler im Code. Die Fehler werden nach der Fehlerart (Analysefehler (AF), Grobentwurfsfehler (GF), Feinentwurfsfehler (FF), Implementierungsfehler (IF)) aufgeschlüsselt. (Werte: *)\n\nErklärung/Empfehlungen:\nEnthält der Code viele Fehler, dann wurde das Dokument nicht ausreichend geprüft. Es muss immer beachtet werden, dass die Fehler aus dem Vorgabedokument übernommen werden. Wurde das Dokument mehrmals geprüft und enthält trotzdem viele Fehler, dann sollte die Zusammenstellung der Reviewteams genauer untersucht werden. Möglicherweise waren die ausgewählten Mitarbeiter als Gutachter nicht qualifiziert.','Fehlerart','Fehler','de',18),(41,'Errors in the documentation','Errors in the documentation','Description: \nThe diagram shows the remaining errors in the documentation. The errors are grouped by the kind of error. (Values: *)\n\nExplanation/Recommendations:\nIf the documentation contains a lot of errors, then you did not review the document thoroughly. Maybe you have forgotten to invite the customer to a review of the documentation. The customer should always participate in a review of the documentation, because the customer detects a lot of errors which would not be found by the internal reviewers. The customer can also find missing functionality which can be easily integrated in the system, if the development of the system is in an earlier project phase. If the documentation was reviewed more than once and contains still a lot of errors, then you should take a closer look at the different review teams. Maybe you have chosen the wrong developers.','Kind of error','Errors','en',19),(42,'Restfehler im Handbuch','Restfehler im Handbuch','Beschreibung: \nDas Diagramm zeigt die Restfehler im Handbuch. Die Fehler werden nach der Fehlerart (Analysefehler (AF), Handbuchfehler (HF)) aufgeschlüsselt. (Werte: *)\n\nErklärung/Empfehlungen:\nEnthält das Handbuch noch viele Analysefehler (mehr als 30), dann wurde das Dokument nicht ausreichend geprüft. Möglicherweise wurde der Kunde nicht zu einem Review des Handbuchs eingeladen. Der Kunde sollte allerdings immer an mindestens einem Review teilnehmen, da er viele Fehler findet, die die Gutachter nicht entdecken können. Außerdem kann er auf fehlende Funktionalitäten hinweisen, die zu einem frühen Zeitpunkt noch recht günstig integriert werden können.\nWurde die Spezifikation mehrmals geprüft und enthält trotzdem viele Fehler, dann sollte die Zusammenstellung der Reviewteams genauer untersucht werden. Möglicherweise waren die ausgewählten Mitarbeiter als Gutachter nicht qualifiziert.','Fehlerart','Fehler','de',19),(43,'Efficiency of specification reviews','Efficiency of specification reviews','Description: \nThe diagram shows the efficiency of the specification reviews. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the effort for the specification reviews.\nThe second bar shows the detected errors.\nThe third bar shows the effort for the correction of the document.\n\nThis diagram gives you an idea about the cost and benefit of the reviews. You can see if the review effort was justifiable, means the review team found enough errors in reference to the review effort.','y','x','en',20),(44,'Effizienz der Spezifikationsreviews','Effizienz der Spezifikationsreviews','Beschreibung: \nDas Diagramm zeigt die Effizienz der Spezifikationsreviews. (Werte: *)\n\nErklärungen/Empfehlungen:\nDer erste Balken zeigt den Aufwand für die Spezifikationsreviews.\nDer zweite Balken zeigt die gefundenen Fehler.\nDer dritte Balken zei