 can see if the review effort was justifiable, means the review team found enough errors in reference to the review effort.','y','x','en',22),(48,'Effizienz der Moduldesignreviews','Effizienz der Moduldesignreviews','Beschreibung: \nDas Diagramm zeigt die Effizienz der Moduledesignsreviews. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt den Aufwand für die Moduledesignreviews.\nDer zweite Balken zeigt die gefundenen Fehler.\nDer dritte Balken zeigt den Korrekturaufwand.\n\nDieses Diagramm zeigt Kosten und Nutzen eines Reviews an. Es kann aufgrund der Balken leicht festgestellt werden, ob der Aufwand für einen Review gerechtfertigt war, das heißt ob genügend Fehler gefunden wurden, oder ob man auf den Review besser verzichtet hätte.','y','x','de',22),(49,'Efficiency of code reviews','Efficiency of code reviews','Description: \nThe diagram shows the efficiency of the code reviews. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the effort for the code reviews.\nThe second bar shows the detected errors.\nThe third bar shows the effort for the correction of the document.\n\nThis diagram gives you an idea about the cost and benefit of the reviews. You can see if the review effort was justifiable, means the review team found enough errors in reference to the review effort.','y','x','en',23),(50,'Effizienz der Codereviews','Effizienz der Codereviews','Beschreibung: \nDas Diagramm zeigt die Effizienz der Codereviews. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt den Aufwand für die Codereviews.\nDer zweite Balken zeigt die gefundenen Fehler.\nDer dritte Balken zeigt den Korrekturaufwand.\n\nDieses Diagramm zeigt Kosten und Nutzen eines Reviews an. Es kann aufgrund der Balken leicht festgestellt werden, ob der Aufwand für einen Review gerechtfertigt war, das heißt ob genügend Fehler gefunden wurden, oder ob man auf den Review besser verzichtet hätte.','y','x','de',23),(51,'Efficiency of documentation reviews','Efficiency of doc