','en',27),(58,'Effizienz der Integrationstests','Effizienz der Integrationstests','Beschreibung: \nDieses Diagramm zeigt die Effizienz der Integrationstests. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt den Aufwand für die Integrationstest.\nDer zweite Balken zeigt die gefundene Fehler.\nDer dritte Balken zeigt den Korrekturaufwand.\n\nDieses Diagramm zeigt Kosten und Nutzen eines Tests an. Es kann aufgrund der Balken leicht festgestellt werden, ob der Aufwand für einen Test gerechtfertigt war, das heißt ob genügend Fehler gefunden wurden, oder ob man auf den Test besser verzichtet hätte.','y','x','de',27),(59,'Efficiency of acceptance test','Efficiency of acceptance test','Description: \nThe diagram shows the efficiency of the acceptance tests. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the effort for the acceptance tests.\nThe second bar shows the detected errors.\nThe third bar shows the effort for the correction of the code.\n\nThis diagram gives you an idea about the cost and benefit of the tests. You can see if the test effort was justifiable, means the testers found enough errors in reference to the test effort. \nAttention! This shows the qualification of the customer as a tester.','y','x','en',28),(60,'Effizienz der Abnahmetests','Effizienz der Abnahmetests','Beschreibung: \nDieses Diagramm zeigt die Effizienz der Abnahmetests. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt den Aufwand für die Abnahmetest.\nDer zweite Balken zeigt die gefundene Fehler.\nDer dritte Balken zeigt den Korrekturaufwand.\n\nDieses Diagramm zeigt Kosten und Nutzen eines Tests an. Es kann aufgrund der Balken leicht festgestellt werden, ob der Aufwand für einen Test gerechtfertigt war, das heißt ob genügend Fehler gefunden wurden, oder ob man auf den Test besser verzichtet hätte. \nAchtung! Dies zeigt allerdings nur, ob der Kunde ein guter Tester war.','y','x','de',28),(61,'Effectiveness of specification reviews','Effectiveness of specification reviews','Description: \nThis diagram shows the effectiveness of the specification reviews. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the numer of errors detected in the reviews.\nThe second bar shows the errors which are already in the document.\n\nBy means of this values you can see if you have chosen the right reviewers. If the reviewers have detected only a few of the contained errors, then you did not choose the best qualified employees. If the reviewers have detected a lot of errors then you have chosen qualified developers.','y','x','en',29),(62,'Effektivität der Spezifikationsreviews','Effektivität der Spezifikationsreviews','Beschreibung: \nDieses Diagram zeigt die Effektivität der Spezifikationsreviews. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt die Anzahl der Fehler, die durch den Review gefunden wurden. \nDer zweite Balken zeigt die Fehler, die im Dokument enthalten sind.\n\nAnhand dieser Werte kann festgestellt werden, ob die Gutachterwahl sorgfältig getroffen wurde. Wurden nur wenige der im Dokument enthaltenen Fehler gefunden, dann deutet dies auf eine schlechte Gutachterwahl hin. Wurden hingegen viele der im Dokument enthaltenen Fehler gefunden, dann wurden qualifizierte Mitarbeiter als Gutachter eingesetzt.','y','x','de',29),(63,'Effectiveness of system design reviews','Effectiveness of system design reviews','Description: \nThis diagram shows the effectiveness of the system design reviews. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the numer of errors detected in the reviews.\nThe second bar shows the errors which are already in the document.\n\nBy means of this values you can see if you have chosen the right reviewers. If the reviewers have detected only a few of the contained errors, then you did not choose the best qualified employees. If the reviewers have detected a lot of errors then you have chosen qualified developers.','y','x','en',30),(64,'Effektivität der Systemdesignreviews','Effektivität der Systemdesignreviews','Beschreibung: \nDieses Diagram zeigt die Effektivität der Systemdesignreviews. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt die Anzahl der Fehler, die durch den Review gefunden wurden. \nDer zweite Balken zeigt die Fehler, die im Dokument enthalten sind.\n\nAnhand dieser Werte kann festgestellt werden, ob die Gutachterwahl sorgfältig getroffen wurde. Wurden nur wenige der im Dokument enthaltenen Fehler gefunden, dann deutet dies auf eine schlechte Gutachterwahl hin. Wurden hingegen viele der im Dokument enthaltenen Fehler gefunden, dann wurden qualifizierte Mitarbeiter als Gutachter eingesetzt.','y','x','de',30),(65,'Effectiveness of module design reviews','Effectiveness of module design reviews','Description: \nThis diagram shows the effectiveness of the module design reviews. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the numer of errors detected in the reviews.\nThe second bar shows the errors which are already in the document.\n\nBy means of this values you can see if you have chosen the right reviewers. If the reviewers have detected only a few of the contained errors, then you did not choose the best qualified employees. If the reviewers have detected a lot of errors then you have chosen qualified developers.','y','x','en',31),(66,'Effektivität der Moduldesignreviews','Effektivität der Moduldesignreviews','Beschreibung: \nDieses Diagram zeigt die Effektivität der Moduldesignreviews. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt die Anzahl der Fehler, die durch den Review gefunden wurden. \nDer zweite Balken zeigt die Fehler, die im Dokument enthalten sind.\n\nAnhand dieser Werte kann festgestellt werden, ob die Gutachterwahl sorgfältig getroffen wurde. Wurden nur wenige der im Dokument enthaltenen Fehler gefunden, dann deutet dies auf eine schlechte Gutachterwahl hin. Wurden hingegen viele der im Dokument enthaltenen Fehler gefunden, dann wurden qualifizierte Mitarbeiter als Gutachter eingesetzt.','y','x','de',31),(67,'Effectiveness of code reviews','Effectiveness of code reviews','Description: \nThis diagram shows the effectiveness of the code reviews. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the numer of errors detected in the reviews.\nThe second bar shows the errors which are already in the document.\n\nBy means of this values you can see if you have chosen the right reviewers. If the reviewers have detected only a few of the contained errors, then you did not choose the best qualified employees. If the reviewers have detected a lot of errors then you have chosen qualified developers.','y','x','en',32),(68,'Effektivität der Codereviews','Effektivität der Codereviews','Beschreibung: \nDieses Diagram zeigt die Effektivität der Codereviews. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt die Anzahl der Fehler, die durch den Review gefunden wurden. \nDer zweite Balken zeigt die Fehler, die im Dokument enthalten sind.\n\nAnhand dieser Werte kann festgestellt werden, ob die Gutachterwahl sorgfältig getroffen wurde. Wurden nur wenige der im Dokument enthaltenen Fehler gefunden, dann deutet dies auf eine schlechte Gutachterwahl hin. Wurden hingegen viele der im Dokument enthaltenen Fehler gefunden, dann wurden qualifizierte Mitarbeiter als Gutachter eingesetzt.','y','x','de',32),(69,'Effectiveness of documentation reviews','Effectiveness of documentation reviews','Description: \nThis diagram shows the effectiveness of the documentation reviews. (Values: *)\n\nExplanation/Recommendations:\nThe first bar shows the numer of errors detected in the reviews.\nThe second bar shows the errors which are already in the document.\n\nBy means of this values you can see if you have chosen the right reviewers. If the reviewers have detected only a few of the contained errors, then you did not choose the best qualified employees. If the reviewers have detected a lot of errors then you have chosen qualified developers.','y','x','en',33),(70,'Effektivität der Handbuchreviews','Effektivität der Handbuchreviews','Beschreibung: \nDieses Diagram zeigt die Effektivität der Handbuchreviews. (Werte: *)\n\nErklärung/Empfehlungen:\nDer erste Balken zeigt die Anzahl der Fehler, die durch den Review gefunden wurden. \nDer zweite Balken zeigt die Fehler, die im Dokument enthalten sind.\n\nAnhand dieser Werte kann festgestellt werden, ob die Gutachterwahl sorgfältig getroffen wurde. Wurden nur wenige der im Dokument enthaltenen Fehler gefunden, dann deutet dies auf eine schlechte Gutachterwahl hin. Wurden hingegen viele der im Dokument enthaltenen Fehler gefunden, dann wurden qualifizierte Mitarbeiter als Gutachter eingesetzt.','y','x','de',33),(71,'AFPs lost in reviews','AFPs lost in reviews','Description:\nThis diagram shows the number of AFPs lost in reviews. The smaller the number of AFPs, the better the review process. (Values: *)\n\nExplanation/Recommendation:\nLoosing only a few AFPs is acceptable. Focus on those reviews that lead to a higher number of losses and improve the review process by taking care of the team members and consistency between the documents. Especially in the very early phases and for the review of the manuals/documentation the customer should be part of the review team.','Reviews','AFPs','en',38),(72,'Verluste durch Reviews','Verluste durch Reviews','Beschreibung: \nDieses Diagramm zeigt die Verluste von AFPs an, die durch Reviews entstanden sind. (Werte: *)\n\nErklärung/Empfehlungen:\nDer Verlust nur weniger AFPs ist akzeptabel. Das Hauptaugenmerk sollte auf jene Reviews gelegt werden, die zu höheren Verlusten führten. Durch sorgfältige Auswahl qualifizierter Gutachter und Berücksichtigung der Konsistenz zwischen den Dokumenten kann der Reviewprozess verbessert werden. Speziell in den sehr frühen Phasen des Projekts und beim Review von Handbüchern/Dokumentationen sollte der Kunde involviert werden.','Reviews','AFPs','de',38),(73,'AFPs lost in tests','AFPs lost in tests','Description:\nThis diagram visualizes the loss of AFPs during the test activities. The smaller the number of AFPs, the better the test and correction process. (Values: *)\n\nExplanation/Recommendations:\nLoosing only a few AFPs is acceptable. Focus on those tests that lead to a higher number of losses and improve the test and correction process by checking the qualification of the testing team.','Tests','AFPs','en',39),(74,'Verluste durch Tests','Verluste durch Tests','Beschreibung: \nDieses Diagramm zeigt die Verluste von AFPs an, die durch Tests entstanden sind. (Werte: *)\n\nErklärung/Empfehlungen:\nDer Verlust nur weniger AFPs ist akzeptabel. Das Hauptaugenmerk sollte auf jene Tests gelegt werden, die zu höheren Verlusten führten. Durch sorgfältige Auswahl qualifizierter Tester kann der Test- und Korrekturprozess verbessert werden.','Tests','AFPs','de',39),(75,'Distribution of effort','Distribution of effort','Description: \nThis diagram shows the distribution of the ressources for several project phases. (Values: *). Please note that the diagram can only be drawn after delivering the system.\n\nExplanation/Recommendations:\nIf the effort for the specification is low, this would indicate that the specification was not a good reference document for the system design. Uncorrect reference documents result in uncorrect code, which could only be improved by testing. A high effort for testing indicates that the reference documents were incorrect and incomplete. A high effort in the specification and the design phase leads often to a low effort in testing.','Phases','Effort','en',40),(76,'Aufwandsverteilung','Aufwandsverteilung','Beschreibung: \nDieses Diagramm zeigt, wie die Ressourcen auf die einzelnen Phasen verteilt wurden. (Werte: *)\n\nErklärung/Empfehlungen:\nGeringer Aufwand für die Spezifikation könnte auf ein schlechts Vorgabedokument für den Entwurf hindeuten. Schlechte Vorgabedokumente können zu einem schlechten Code führen, der nur durch intensives Testen verbessert werden kann. Ein erhöhter Testaufwand würde somit auf schlechte Vorgabedokumente hindeuten. Ein erhöhter Aufwand in der Spezifikations- und Entwurfsphase führt hingegen zu einem geringeren Testaufwand.','Phasen','Aufwand','de',40),(500,'','','The author of the specification shouldn\'t be appointed to do the review!',NULL,NULL,'en',2500),(501,'','','Sie sollten den Autor der Spezifikation nicht auch als Prüfer einsetzen!',NULL,NULL,'de',2500),(502,'','','The author of the system design shouldn\'t be appointed to do the review!',NULL,NULL,'en',2501),(503,'','','Sie sollten den Autor des Systemdesigns nicht auch als Prüfer einsetzen!',NULL,NULL,'de',2501),(504,'','','The author of the module design shouldn\'t be appointed to do the review!',NULL,NULL,'en',2502),(505,'','','Sie sollten den Autor des Moduledesigns nicht auch als Prüfer einsetzen!',NULL,NULL,'de',2502),(506,'','','The author of the code shouldn\'t be appointed to do the review!',NULL,NULL,'en',2503),(507,'','','Sie sollten den Autor des Codes nicht auch als Prüfer einsetzen!',NULL,NULL,'de',2503),(508,'','','The author of the manuals shouldn\'t be appointed to do the review!',NULL,NULL,'en',2504),(509,'','','Sie sollten den Autor des Handbuchs nicht auch als Prüfer einsetzen!',NULL,NULL,'de',2504),(510,'','','You should appoint the author of the document to do the correction of the specification!',NULL,NULL,'en',2505),(511,'','','Sie sollten den Autor der Spezifikation für die Korrektur des Dokuments einsetzen!',NULL,NULL,'de',2505),(512,'','','You should appoint the author of the document to do the correction of the system design!',NULL,NULL,'en',2506),(513,'','','Sie sollten den Autor des Systemdesigns für die Korrektur des Dokuments einsetzen!',NULL,NULL,'de',2506),(514,'','','You should appoint the author of the document to do the correction of the module design!',NULL,NULL,'en',2507),(515,'','','Sie sollten den Autor des Moduldesigns für die Korrektur de