ent according to the last review.',NULL,NULL,'en',2557),(697,'','','Vous avez demandé à Axel d\'arrêter son activité. Il travaillait sur la correction d\'un document. Vous ne devez pas commencer une autre révision tant que la correction n\'est pas terminée.',NULL,NULL,'fr',2557),(698,'','','Sie haben Axel angewiesen seine Tätigkeit sofort abzubrechen.\nAxel war jedoch gerade mit der Korrektur eines Dokuments beschäftigt.\nBitte bedenken Sie, dass Sie erst nach erfolgreicher Beendigung der Korrektur einen weiteren Review für dieses Dokuments durchführen können.\nWeisen Sie darum einen anderen Mitarbeiter an die begonnene Korrekur fertig zu stellen.',NULL,NULL,'de',2557),(699,'','','You have commissioned Bernd to abort his activity. Bernd was just working on the correction of a document.\nYou ought to consider that you cannot start another review until somebody has finished the correction of the document according to the last review.',NULL,NULL,'en',2558),(700,'Durée - positif','Durée - positif','Excellent! Vous n\'avez pas dépassé la limite de 270 jours.',NULL,NULL,'fr',1),(701,'Durée - négatif','Durée - négatif','Attention! Vous avez déjà dépassé la limite des 270 jours',NULL,NULL,'fr',2),(702,'Coûts du projet - positif','Coûts - positif','Excellent! Vous avez dépensé * EUR du budget alloué (225000 EUR). ',NULL,NULL,'fr',3),(703,'Coûts du projet - négatif','Coûts - négatif','Attention! Vous avez dépensé * EUR dépassant ainsi le budget alloué (225000 EUR).',NULL,NULL,'fr',4),(704,'PFAs réalisés - négatif','PFAs réalisés - négatif','Attention! Vous n\'avez implémenté que *% de PFAs alors qu\'au moins 95% de PFAs doivent être implémentés!',NULL,NULL,'fr',5),(705,'PFAs réalisés - positif','PFAs réalisés - positif','Très bien! Vous avez implémenté *% de PFAs atteignant ainsi la limite exigée qui est 95%.',NULL,NULL,'fr',6),(706,'Erreurs par KLOC - positif','Erreurs par KLOC positif','Très bien! Le code ne contient que * erreurs par KLOC.  Vous n\'avez pas dépassé la limite exigée qui est de 12 erreurs par KLOC au maximum.',NULL,NULL,'fr',7),(707,'Erreurs par KLOC - négatif','Erreurs par KLOC négatif','Attention! Le code contient * erreurs par KLOC.  Vous avez dépassé la limite exigée qui est de 12 erreurs par KLOC au maximum. ',NULL,NULL,'fr',8),(708,'Erreurs par KLOC - négatif','Erreurs par KLOC négatif','Attention! Vous n\'avez pas encore commencé l\'implémentation. Le code ne doit pas contenir plus de 12 erreurs par KLOC.',NULL,NULL,'fr',60),(709,'PFAs réalisés dans le manuel - positif','PFAs réalisés dans le manuel: positif','Très bien! Le manuel couvre *% des PFAs alors que la limite est de 95% des FPAs.',NULL,NULL,'fr',9),(710,'PFAs réalisés dans le manuel - négatif','PFAs réalisés dans le manuel: négatif','Attention! Le manuel ne couvre que * % des PFAs alors que la limite exigée est de 95% des PFAs.',NULL,NULL,'fr',10),(711,'erreurs par page - positif','erreurs par page positif','Très bien! Le manuel ne contient que * erreurs par page. Vous êtes en dessous de la limite maximale de 0.5 erreurs par page.',NULL,NULL,'fr',11),(712,'erreurs par page - négatif','erreurs par page: négatif','Attention! Le manuel contient * erreurs par page. Vous avez dépassé la limite maximale qui est de l\'ordre de 0.5 erreurs par page.',NULL,NULL,'fr',12),(713,'erreurs par page - négatif','erreurs par page négatif','Attention! Vous n\'avez pas encore commencé la rédaction du manuel. Il ne faut pas dépasser la limite maximale qui est de l\'ordre de 0.5 erreurs par page.',NULL,NULL,'fr',61),(714,'Complétude des documents','Complétude des documents','Le diagramme montre l\'exhaustivité de la documentation du projet. (Values: *)\n\nUne documentation de reférence est acceptable si l\'exhaustivité des documents de la spécification et de la conception est élevée (~ 200 PFAs). \nSi pour la conception des modules, elle est insuffisante (inf. à 190 PFAs), alors probablement vous avez oublié de corriger les documents précédents.','Documents','PFAs','fr',13),(715,'Erreurs dans les documents','Erreurs dans les documents','Ce diagramme montre le reste des erreurs dans le document. (Values: *)\n\nSi la spécification contient plus de 30 erreurs, cela est peut être dû à la révision non complète de la documentation.\nDans les phases suivantes, la correction des documents est plus coûteuse quand le nombre d\'erreurs augmente tout au long du projet.\nComme conseil, il faut produire des documents complets et de bonne qualité dans les premières phases.\n\nAttention:\nPour plus d\'information sur les differentes phases du project, consulter les diagrammes suivants: \n   => Erreurs dans la specification, \n   => Erreurs dans la conception du système, \n   => Erreurs dans la conception des modules, \n   => Erreurs dans le code et \n   => Erreurs dans la documentation.','Documents','erreurs','fr',14),(716,'Erreurs dans la spécification','Erreurs dans la spécification','Ce diagramme montre le reste des erreurs dans la spécification. (Values: *)\n\nSi les spécifications contiennent plus de 30 erreurs d\'analyse, ceci est peut être dû à la révision non exhaustive de la documentation.\nProbablement, vous avez oublié d\'inviter le client pour la révision ensemble des spécifications.\nLe client doit toujours participer dans la révision des spécifications car sa présence permet de détecter plus d\'erreurs s\'il y en a.\nAu début du projet, le client peut aider à trouver des fonctionnalités manquantes et qui peuvent être facilement intégrées dans le système.\nSi le document des spécifications a été revu plusieurs fois et il y a toujours des erreurs, alors il faut revoir la composante du groupe de révision. Probablement, vous avez choisi pour la révision des personnes moins compétentes.\n\nNB:\nLe document des spécifications ne contient que les erreurs d\'analyse (EA).','Type d\'erreur','Erreurs','fr',15),(717,'Erreurs dans la conception du système','Erreurs dans la conception du système','Ce diagramme montre le reste des erreurs dans la conception du système.\n\nLes erreurs sont groupées par type:\n=> Erreurs d\'analyse (EA) et\n=> Erreurs de conception du système (ECS)\n(Values: *)\n\nSi la conception du système renferme beaucoup d\'erreurs, ceci est peut être dû à la révision non exhaustive de la documentation.\nIl ne faut pas oublier que le nombre d\'erreurs augmente tout au long du projet. \n\nSi le document relatif à la conception du système a été revu plusieurs fois et qu\'il contient toujours des erreurs, alors il faut revoir la composante du groupe de révision. Probablement, vous avez choisi pour la révision des personnes moins compétentes.','Type d\'erreur','erreurs','fr',16),(718,'Erreurs dans la conception des modules','Erreurs dans la conception des modules','Le diagramme montre le reste des erreurs de la conception des modules.\nLes erreurs sont groupées par type d´erreur:\n  => Erreurs d´analyse (EA),\n  => Erreurs de la conception du système (ECS) and\n  => Erreurs de la conception des modules (ECM). \n(Values: *)\n\nSi la conception des modules contient beaucoup d´erreurs, ceci est peut être dû à la révision incomplète du document.\nIl ne faut pas oublier que le nombre des erreurs augmente tout au long du projet.\nS´il y a toujours des erreurs après plusieurs révisions du document de conception des modules, alors il faut revoir la composante des groupes de révision. Probablement, vous avez choisi des personnes moins compétentes.','Type d\'erreur','Erreurs','fr',17),(719,'Erreurs dans le code','Erreurs dans le code','Le diagramme montre le reste des erreurs dans le code.\nLes erreurs sont groupées par type d´erreur:\n  => Erreurs d´analyse (EA),\n  => Erreurs de la conception du système (ECS) and\n  => Erreurs de la conception des modules (ECM). \n  => Erreurs d´implémentation (EI). \n(Values: *)\n\nSi le code contient beaucoup d´erreurs, ceci est peut être dû à la révision non exhaustive.\nIl ne faut pas oublier que le nombre des erreurs augmente tout au long du projet.\nS´il y a toujours des erreurs après plusieurs révisions du code, alors il faut revoir la composante du groupe de révision. Probablement, vous avez choisi des personnes moins compétentes.','Type d´erreur','Erreurs','fr',18),(720,'Erreurs dans la documentation','Erreurs dans la documentation','Le diagramme montre le reste des erreurs dans la documentation.\nLes erreurs sont groupées par type d´erreur:\n  => Erreurs d´analyse (EA),\n => Erreurs de documentation (ED).\n(Values: *)\n\nSi la documentation contient beaucoup d´erreurs, ceci est peut être dû à la révision non exhaustive.\nPeut être, vous avez oublié d\'inviter le client pour participer dans la révision de la documentation. Sa présence est indispensable pour pouvoir détecter plus d´erreurs.\nSi le développement du système est dans ses premières phases, le client peut trouver les fonctionnalités manquantes qui peuvent être intégrées facilement dans le système.\nS´il y a toujours des erreurs après plusieurs révisions de la documentation, alors il faut revoir la composante du groupe de révision. Probablement, vous avez choisi des personnes moins compétentes.','Type d´erreur','Erreurs','fr',19),(721,'Rendement de la révision des spécifications','Rendement de la révision des spécifications','Le diagramme montre le rendement de la révision des spécifications. (Values: *)\n\nLa première barre montre l´effort consenti dans la révision des spécifications.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du document.\n\nLe diagramme donne une idée sur le coût et les retombés de la révision.\nOn peut constater l´utilité de la révision dans la recherche des erreurs.','y','x','fr',20),(722,'Rendement de révision de la conception du système','Rendement de révision de la conception du système','Le diagramme montre le rendement de révision de la conception du système. (Values: *)\n\nLa première barre montre l´effort consenti par les participants dans la révision.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du document.\n\nLe diagramme donne une idée sur le coût et les retombés de la révision.\nOn peut constater l´utilité de la révision dans la recherche des erreurs.','y','x','fr',21),(723,'Rendement de révision de la conception des modules','Rendement de révision de la conception des modules','Le diagramme montre le rendement de révision de la conception des modules. (Values: *)\n\nLa première barre montre l´effort consenti par les participants dans la révision des modules.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du document.\n\nLe diagramme donne une idée sur le coût et les retombés de la révision.\nOn peut constater l´utilité de la révision dans la recherche des erreurs.','y','x','fr',22),(724,'Rendement de la révision du code','Rendement de la révision du code','Le diagramme montre le rendement de la révision du code. (Values: *)\n\nLa première barre montre l´effort consenti par les participants dans le code.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du document.\n\nLe diagramme donne une idée sur le coût et les retombés de la révision.\nOn peut constater l´utilité de la révision dans la recherche des erreurs.','y','x','fr',23),(725,'Rendement de révision de la documentation','Rendement de révision de la documentation','Le diagramme montre le rendement de révision de la documentation. (Values: *)\n\nLa première barre montre l´effort consenti par les participants dans la révision de la documentation.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du document.\n\nLe diagramme donne une idée sur le coût et les retombés de la révision.\nOn peut constater l´utilité de la révision dans la recherche des erreurs.','y','x','fr',24),(726,'Rendement du test  des modules','Rendement du test  des modules','Le diagramme montre le rendement du test  des modules. (Values: *)\n\nLa première barre montre l´effort consenti dans le test des modules.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du code.\n\nLe diagramme donne une idée sur le coût et les résultats du test.\nOn peut constater si les tests effectués ont permis de trouver beaucoup d\'erreurs.','y','x','fr',25),(727,'Rendement du test  du système','Rendement du test  du système','Le diagramme montre le rendement du test  du système. (Values: *)\n\nLa première barre montre l´effort consenti dans le test du système.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du code.\n\nLe diagramme donne une idée sur le coût et les résultats du test.\nOn peut constater si les tests effectués ont permis de trouver beaucoup d\'erreurs.','y','x','fr',26),(728,'Rendement du test  d\'intégration','Rendement du test  d\'intégration','Le diagramme montre le rendement du test  d´intégration. (Values: *)\n\nLa première barre montre l´effort consenti dans le test d´intégration.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du code.\n\nLe diagramme donne une idée sur le coût et les résultats du test.\nOn peut constater si les tests effectués ont permis de trouver beaucoup d\'erreurs.','y','x','fr',27),(729,'Rendement du test  d\'acceptance','Rendement du test  d\'acceptance','Le diagramme montre le rendement du test  d´acceptance. (Values: *)\n\nLa première barre montre l´effort consenti dans le test d´acceptance.\nLa seconde barre montre les erreurs détectées.\nLa troisième barre montre l´effort consenti pour la correction du code.\n\nLe diagramme donne une idée sur le coût et les résultats du test.\nOn peut constater si les tests effectués ont permis de trouver beaucoup d\'erreurs.\nAttention! Ceci montre les capacités du client en matière de test.','y','x','fr',28),(730,'Efficacité de la révision des spécifications','Efficacité de la révision des spécifications','Le diagramme montre l\'efficacité de la révision des spécifications. (Values: *)\n\nLa première barre montre le nombre des erreurs détectées durant la révision.\nLa seconde barre montre les erreurs non détectées. Les nombres montrés permettent de constater si vous avez choisi les bonnes personnes pour la révision. Un nombre faible d\'erreurs détectées parmi toutes les existantes signifie que les personnes engagées sont efficaces, sinon elles ne sont pas.','y','x','fr',29),(731,'Efficacité de révision de la conception du système','Efficacité de révision de la conception du système','Le diagramme montre l\'efficacité de révision de la conception du système. (Values: *)\n\nLa première barre montre le nombre des erreurs détectées durant la révision.\nLa seconde barre montre les erreurs non détectées. Les nombres montrés permettent de constater si vous avez choisi les bonnes personnes pour la révision. Un nombre faible d\'erreurs détectées parmi toutes les existantes signifie que les personnes engagées sont efficaces, sinon elles ne sont pas.','y','x','fr',30),(732,'Efficacité de révision de la conception des modules','Efficacité de révision de la conception des modules','Le diagramme montre l\'efficacité de révision de la conception des modules. (Values: *)\n\nLa première barre montre le nombre des erreurs détectées durant la révision.\nLa seconde barre montre les erreurs non détectées. Les nombres montrés permettent de constater si vous avez choisi les bonnes personnes pour la révision. Un nombre faible d\'erreurs détectées parmi toutes les existantes signifie que les personnes engagées sont efficaces, sinon elles ne sont pas.','y','x','fr',31),(733,'Efficacité de la révision du code','Efficacité de la révision du code','Le diagramme montre l\'efficacité de la révision du code. (Values: *)\n\nLa première barre montre le nombre des erreurs détectées durant la révision.\nLa seconde barre montre les erreurs non détectées. Les nombres montrés permettent de constater si vous avez choisi les bonnes personnes pour la révision. Un nombre faible d\'erreurs détectées parmi toutes les existantes signifie que les personnes engagées sont efficaces, sinon elles ne sont pas.','y','x','fr',32),(734,'Efficacité de révision de la documentation','Efficacité de révision de la documentation','Le diagramme montre l\'efficacité de révision de la documentation. (Values: *)\n\nLa première barre montre le nombre des erreurs détectées durant la révision.\nLa seconde barre montre les erreurs non détectées. Les nombres montrés permettent de constater si vous avez choisi les bonnes personnes pour la révision. Un nombre faible d\'erreurs détectées parmi toutes les existantes signifie que les personnes engagées sont efficaces, sinon elles ne sont pas.','y','x','fr',33),(735,'PFAs manqués durant la révision','PFAs manqués durant la révision','Le diagramme montre le nombre des PFAs manqués durant la révision. (Values: *)\n\nLa raison de cela peut résider dans la non qualification du groupe chargé de la révision. Donc, il faut revoir la composante du groupe de révision.','Révision','PFAs','fr',38),(736,'PFAs manqués pendant le test','PFAs manqués pendant le test','Le diagramme montre le nombre des PFAs manqués pendant le test. (Values: *)\n\nLa raison de cela peut résider dans la non qualification du testeur. Donc, il faut revoir les qualifications du testeur.','Test','PFAs','fr',39),(737,'Distribution de l\'effort','Distribution de l\'effort','Le diagramme montre comment les ressources sont distribuées sur les différentes phases du projet. (Values: *)\n\nSi l\'effort dépensé sur les spécifications est petit, alors le document des spécifications ne peut être fiable pour servir à la conception du système.\nSe reférer à des documents non fiables resulte en code non fiable dont la qualité peut être amélioré que par test.\nUn grand effort de test indique que les documents de référence sont incorrects et incomplets.\nUn grand effort dans les phases de spécification et conception implique souvent un petit effort dans le test.','Phases','Effort','fr',40),(757,'Coding and Testing','Testing activity','\nLegend:\nCD ... coding (begin-end, author(s)), CDRev ... code review (begin-end, author(s)), CDCorr ... code correction (begin-end, author(s)).\nMT ... module test (begin-end, author(s)), MTCorr ... corrections (begin-end, author(s)).\nProject manager decisions and commands that led to zero activities are marked by a small black triangle.\n\nDescription:\nThis chart visualizes the author(s) of the code and the member(s) of the review/correction team(s) used in the coding and testing phase.\n\nExplanation/Recommendation:\nThe more the project is following the Waterfall model, the more likely it is that succeeding phases are based on tested and finalized artifacts of previous phases. However, in order to save time it is possible to overlap the phases, which then means that one needs more effort to ensure consistency between the different artifacts. ','Date','Phase','en',3001),(758,'Coding and Testing phase','Testing activity','Legende:\nCD ... Implementierung (Anfang-Ende, Autor(en)), CDRev ... Codereview (Anfang-Ende, Autor(en)), CDCorr ... Codekorrektur (Anfang-Ende, Autor(en)). MT ... Modultest (Anfang-Ende, Autor(en)), MTCorr ... Korrekturen (Anfang-Ende, Autor(en)). Entscheidungen und Anweisungen des Projektmanagers, die zu keinen Aktivitäten führten, sind durch kleine schwarze Dreiecke gekennzeichnet.\n\nBeschreibung:\nDiese Graphik zeigt den/die Autor(en) des Codes und die Mitglieder der Review-/Korrekturteams, die während der Implementierungs- bzw. Testphase zum Einsatz kamen.\n\nErklärung/Empfehlungen:\nJe mehr das Projekt dem Wasserfallmodell folgt, desto eher basieren nachfolgende Phasen auf getesteten und finalisierten Zwischenprodukten früherer Phasen. Das Überlappen von Phasen spart Zeit, was aber zu mehr Aufwand führt, um die Konsistenz zwischen den verschiedenen Zwischenprodukten sicherzustellen.','Date','Phase','de',3001),(765,'Monitoring','Inspection','\nLegend:\nAI ... monitoring activity (date). Project manager decisions and commands that led to no result are marked by a small black triangle.\n\nDescription:\nThis chart visualizes all monitoring activities during the project.\n\nExplanation/Recommendations:\nMonitoring activities are vital for good project management. However, too many monitoring activities might also be interpreted as a loss in control over the project.','Date','Type','en',3004),(766,'Monitoring','Inspection','Legende:\nAI ... Kontrollaktivität (Datum). Entscheidungen und Anweisungen des Projektmanagers, die zu keinen Ergebnissen führten, sind durch kleine schwarze Dreiecke gekennzeichnet.\n\nBeschreibung:\nDiese Graphik zeigt alle Kontrollaktivitäten während des Projekts.\n\nErklärung/Empfehlungen:\nKontrolle ist eine wesentliche Aktivität in einem guten Projektmanagement. Zu viele gesetzte Kontrollaktivitäten können aber auch als Verlust der Kontrolle über den Projektverlauf interpretiert werden.','Date','Type','de',3004),(800,'Performance','Performance','Description:\nThis diagram summarizes the goal achievement (days and AFPs) in respect to the original project objectives. The 100 percent line represents the exact goals. The x-axis shows the project duration, the intermediate, and final documents. The y-axis prints the values relative to the project goals. Values higher than 100% indicate better performance, values lower than 100% indicate a loss in performance. (Values: *)\n\nExplaination/Recommendations:\nTypically the quality of documents decreases from document to document. Thus, the better the quality of the system specification, the easier it might be to keep the quality of the suceeding documents. An increase in quality between the module design document and the code indicates that a lot of effort has been spent on testing activities. The exact values of the AFPs can be found in Section 7 (Completeness of documents).','Performance','%','en',3100),(801,'Performanz','Performanz','Beschreibung:\nDieses Diagramm fasst die Zielerreichung (in Tagen bzw. AFPs) bezüglich der ursprünglichen Projektziele zusammen. Die 100%-Marke repräsentiert das Erreichen der exakten Zielvorgabe. Die X-Achse zeigt die Projektdauer und die Zwischen- und Enddokumente. Die Y-Achse weist die Werte im Verhältnis zu den Projektzielen aus. Werte über 100% deuten auf eine bessere Performanz hin, Werte darunter einen Verlust an Performanz. (Werte: *)\n\nErklärung/Empfehlungen:\nTypischerweise verringert sich die Qualität von Dokumenten von Dokument zu Dokument. Je besser daher die Qualität der Systemspezifikation schon ist, desto leichter fällt es, eine gewisse Qualität der nachfolgenden Dokumente zu gewährleisten. Eine Erhöhung der Qualität zwischen dem Moduldesign und der Implementierung weisen daraufhin, daß viel Aufwand für das Testen betrieben wurde. Die exakten AFP-Werte finden sich im Abschnitt 7 (Vollständigkeit der Dokumente).','Performanz','%','de',3100),(812,'Manual preparation','Manual preparation','\nLegend:\nMN ... manual/documentation creation (begin-end, author(s)), MNRev ... review of manuals (begin-end, author(s)), MNCorr ... corrections of manuals (begin-end, author(s)).\nProject manager decisions and commands that led to zero activities are marked by a small black triangle.\n\nDescription:\nThis chart visualizes the author(s) of manuals and the member(s) of the review/correction team(s).\n\nExplanation/Recommendation:\nThe more the project is following the Waterfall model, the more likely it is that succeeding phases are based on tested and finalized artifacts of previous phases. However, in order to save time it is possible to overlap the phases, which then means that one needs more effort to ensure consistency between the different artifacts.\n','Date','Phase','en',3106),(813,'Manual preparation','Manual preparation','Legende:\nMN ... Handbuch-/Dokumentationserstellung (Anfang-Ende, Autor(en)), MNRev ... Handbuchreview (Anfang-Ende, Autor(en)), MNCorr ... Handbuchkorrekturen (Anfang-Ende, Autor(en)). Entscheidungen und Anweisungen des Projektmanagers, die zu keinen Aktivitäten führten, sind durch kleine schwarze Dreiecke gekennzeichnet.\n\nBeschreibung:\nDiese Graphik zeigt den/die Autor(en) der Handbücher und die Mitglieder der Review-/Korrekturteams.\n\nErklärung/Empfehlungen:\nJe mehr das Projekt dem Wasserfallmodell folgt, desto eher basieren nachfolgende Phasen auf getesteten und finalisierten Zwischenprodukten früherer Phasen. Das Überlappen von Phasen spart Zeit, was aber zu mehr Aufwand führt, um die Konsistenz zwischen den verschiedenen Zwischenprodukten sicherzustellen.',NULL,NULL,'de',3106),(814,'Specification and system design','Specification and design','\nLegend:\nSP ... specification phase (begin-end, author(s)), SPRev ... specification review (begin-end, author(s)), SPCorr ... specification correction (begin-end, author(s)), SD ... system design (begin-end, author(s)), SDRev ... system design review (begin-end, author(s)), SDCorr ... system design correction (begin-end, author(s)).\nProject manager decisions and commands that led to zero activities are marked by a small black triangle.\n\nDescription:\nThis chart visualizes the author(s) of documents and the member(s) of the review/correction team(s) used in the specification and system design phase.\n\nExplanation/Recommendation:\nThe more the project is following the Waterfall model, the more likely it is that succeeding phases are based on tested and finalized artifacts of previous phases. However, in order to save time it is possible to overlap the phases, which then means that one needs more effort to ensure consistency between the different artifacts.','Date','Phase','en',3107),(815,'Specification and system design','Specification and design','Legende:\nSP ... 